package com.coco.io._io.iostream.writer;

import java.io.File;
import java.io.FileWriter;
import java.io.IOException;
import java.io.Writer;

/**
 * 文本输出
 */
public class _FileWriter {
    private static final String PATH = "C:\\Users\\Administrator\\Desktop\\javaiotest\\shaw\\shaw-writer.txt";

    private static final String CONTEXT = "";

    public static void main(String[] args) throws IOException {
        writeString();
    }

    private static void writeString() throws IOException {
        File file = new File(PATH);
        Writer writer = new FileWriter(file, Boolean.TRUE);
        writer.write(CONTEXT);
        writer.write("ABC");
        writer.write(CONTEXT, 0, 15);
        writer.flush();//冲刷流
        writer.close();//关闭
        System.out.println("Write Completed!");
    }


}
